import React from 'react'

class App2 extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            name: 'william'
        }
    }

    render() {
        return (
            <div>
                Hello {this.state.name} <br />

            </div>
        )
    }
}

export default App2;
